import React, { useState } from 'react'
import './Sidebar.scss'

export default function Sidebar({sidebar}) {

    console.log(sidebar)

    const [bar, setbar] = useState(false)
    return (
        <>
            <div className={'page row ' + (bar ? 'bar-on' : 'bar-off')}>
                <div className='sidebar'>
                    <div className="top">
                        {sidebar.map((item,index)=>{
                            return (
                                <i key={index} className={'fas ' + (item.icon)}></i>
                                )
                            })}
                    </div>
                    <div className='arrow'>
                        <div className='cols'></div>
                        <div className='cols'></div>
                        <div className='shape'>
                            <i className={'fas ' + (bar ? 'fa-angle-double-left' : 'fa-angle-double-right')} onClick={() => { setbar(!bar) }}></i>
                        </div>
                    </div>
                    <div className="down"></div>
                </div>
                <div className={'navbar-info' + (bar ? ' move' : '')}>
                    {}
                    <h6></h6>
                </div>
            </div>
            {/* <div className="body">
                <div className="body-card">
                
                </div>
            </div> */}
        </>
    )
}
